import React from "react";

const SepetSayfasi = ({ cartItems }) => {
  return (
    <div>
      <h2>Sepetiniz</h2>
      <ul>
        {cartItems.map((item, index) => (
          <li key={index}>
            {item.name} - Quantity: {item.quantity}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default SepetSayfasi;
